// client/src/pages/BicycleRentals.js
import React from 'react';
import '../App.css';

const BicycleRentals = () => {
  return (
    <div className="container" style={{ paddingTop: '50px', textAlign: 'center' }}>
      <h1 style={{ fontSize: '40px', fontWeight: 'bold' }}>Bicycle Rentals</h1>
      <p style={{ fontSize: '18px', color: '#666' }}>
        This is where you can select and book your bicycle for a ride around the city.
      </p>
    </div>
  );
};

export default BicycleRentals;
